text:
A child just died of measles—the first on mainland U.S. in a decade.

I’m not surprised that RFK Jr. doesn’t find this unusual. His anti-vaccine advocacy led to measles deaths in American Samoa.

@SenateGOP, your votes have real-world consequences.

Firing 1,400 VA employees in the name of “efficiency” is outrageous.

This action will hurt veterans and their families—plain and simple.

@SecVetAffairs our heroes deserve better. Your job is to serve veterans, not Musk.

Americans deserve to know their private information is safe from far-right Republicans and corrupt billionaires like Elon Musk.

I’m proud to cosponsor the Taxpayer Data Protection Act to ensure your tax data stays protected.

@HouseDemocrats have your back.
